    [],nt"revision_timestamp": "2016-07-27T22:51:45.349757",nt"name": "browns-park-national-wildlife-refuge-annual-narrative-report-calendar-year-1980",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Browns
    Park NWR outlines Refuge accomplishments during the 1980 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses public participation
    and compliance with environmental and cultural resource mandates. Refuge administration
    is outlined; information about personnel, funding, safety, and technical assistance
    is given. Habitat management is also covered; subjects include wetlands, forests,
    grasslands, grazing, fire management, water rights, and wilderness areas. The wildlife
    section of the report discusses endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources, and
    animal control. The public uses of the Refuge described in this report include interpretive
    programs, hunting, fishing, trapping, wildlife observation, outdoor recreation,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    replacement, and energy conservation. Cooperative programs and items of interest
    are provided at the end. Refuge brochures are attached.",nt"license_title":
